import React, {
    Component
} from "react";
import logo from "./logo.svg";
import "./App.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            apiResponse: "",
            dbResponse: ""
        };
    }

    callAPI() {
        fetch("http://localhost:9000/testAPI")
            .then(res => res.text())
            .then(res => this.setState({
                apiResponse: res
            }))
            .catch(err => err);
    }

    callDB() {
        fetch("http://localhost:9000/testDB")
            .then(res => res.text())
            .then(res => this.setState({
                dbResponse: res
            }))
            .catch(err => err);
    }

    componentDidMount() {
        this.callAPI();
        this.callDB();
    }

    render() {
            return (
              <Router>
                <div>
                  <nav>
                    <ul>
                      <li>
                        <Link to="/">Home</Link>
                      </li>
                      <li>
                        <Link to="/about">About</Link>
                      </li>
                      <li>
                        <Link to="/users">Users</Link>
                      </li>
                    </ul>
                  </nav>
          
                  {/* A <Switch> looks through its children <Route>s and
                      renders the first one that matches the current URL. */}
                  <Switch>
                    <Route path="/about">
                      <About />
                    </Route>
                    <Route path="/users">
                      <Users />
                    </Route>
                    <Route path="/">
                      <Home />
                    </Route>
                  </Switch>
                </div>
              </Router>
            );
          }
}

export default App;
